<template>
  <div class="tiku-detail-all-container">
    <img
      v-if="tikuDetail.status == '0'"
      class="status-img"
      alt="待提交"
      src="data:image/png;base64,"
    >
    <img
      v-if="tikuDetail.status == '1'"
      class="status-img"
      alt="待审核"
      src="data:image/png;base64,"
    >
    <img
      v-if="tikuDetail.status == '2'"
      class="status-img"
      alt="已审核"
      src="data:image/png;base64,"
    >
    <img
      v-if="tikuDetail.status == '3'"
      class="status-img"
      alt="已驳回"
      src="data:image/png;base64,"
    >
    <el-form label-width="150px">
      <el-form-item
        v-if="tikuDetail.memberList"
        label="人名"
      >
        <span
          v-for="(member,i) in tikuDetail.memberList"
          :key="`member${i}`"
        >
          {{ member.name }}
          <el-button
            v-if="member.id"
            type="text"
            style="margin-left: 15px"
            @click="showMore(member.id)"
          >详情</el-button>
        </span>
      </el-form-item>
      <span
        v-for="(item, i) in displayList"
        :key="`question${i}`"
      >
        <el-form-item
          v-if="item.url"
          :label="item.label"
        >
          <viewer>
            <img
              :src="item.url"
              :alt="item.alt"
              style="height: 148px; width: 148px"
            >
          </viewer>
        </el-form-item>
        <el-form-item
          v-else
          :label="item.label"
        >{{
          item.content
        }}</el-form-item>
      </span>
      <el-form-item
        label="审核奖励金额"
        prop="rewardAmount"
      >
        ￥{{ rewardAmount }}
      </el-form-item>
      <el-form-item label="附件">
        <div
          v-for="(item, index) in documentList"
          :key="index"
        >
          <viewer>
            <img
              v-if="isImg(item.url)"
              alt="index"
              :src="hostUrl + item.url"
              width="148px"
              height="148px"
              style="cursor: zoom-in"
            >

            <a
              v-else
              :href="hostUrl + item.url"
              :download="item.name"
            >{{
              item.name
            }}</a>
          </viewer>
        </div>
      </el-form-item>
    </el-form>
    <!-- 人员详情弹窗 -->
    <manDetail
      ref="manDetail"
      :man-detail-data="manDetailData"
    />
    <!-- 图片放大弹窗 -->
    <pictureEnlarge ref="pictureEnlarge" />
  </div>
</template>

<script>
import manDetail from './manDetail';
import pictureEnlarge from '../../../common/pictureEnlarge';

export default {
  name: 'TikuDetail',
  components: {
    manDetail,
    pictureEnlarge,
  },
  props: ['currentId'],
  data() {
    return {
      // getTikuDetail()获取的完整数据
      tikuDetail: {},
      // 处理questionList后用来显示的数据
      displayList: [],
      // getManDetail()获取到人的详情
      manDetailData: {},
      documentList: [],
      rewardAmount: '',
      // 上传图片的服务器主机地址
      hostUrl: window.SITE_CONFIG.cloudUrl,
    };
  },
  watch: {
    currentId() {
      this.getTikuDetail();
    },
  },
  mounted() {
    console.log('mounted题库');
    this.getTikuDetail();
  },
  methods: {
    /**
     * @method
     * @desc 根据id获取当前奖励的详情
     */
    getTikuDetail() {
      const self = this;
      self.displayList = [];
      // console.log(`getTikuDetail()正在查询id =${self.currentId}的详情...`)
      self
        .$http({
          url: self.$http.adornUrl(
            `/approve/approveReward/info/${self.currentId}`,
          ),
          method: 'get',
        })
        .then((res) => {
          console.log('题库', res.data.data);
          // console.log('getTikuDetail()获取到的详情questionList =【\n', res.data.data.approveRewardEntity.approveManageEntity.approveTikuEntity.approveQuestionList, '\n】')
          this.rewardAmount = res.data.data.rewardAmount;
          this.documentList = JSON.parse(res.data.data.document);
          self.tikuDetail = res.data.data;
          const questionList = res.data.data.approveManageEntity.approveTikuEntity
            .approveQuestionList;
          // 题库数据预处理
          for (const item of questionList) {
            switch (item.topicName) {
              case '单选题':
                if (item.answer) {
                  for (const option of item.approveSelectList) {
                    // answer示例：'123'
                    if (
                      item.answer.indexOf('#') < 0
                      && item.answer == option.id
                    ) {
                      self.displayList.push({
                        label: item.title,
                        content: option.content,
                      });
                    }
                  }
                } else {
                  self.displayList.push({
                    label: item.title,
                    content: '',
                  });
                }
                break;
              case '混答+单选':
                if (item.answer) {
                  // answer示例：'1#选项的说明内容'
                  for (const option of item.approveSelectList) {
                    if (
                      item.answer.indexOf('#') >= 0
                      && item.answer.split('#')[0] == option.id
                    ) {
                      self.displayList.push({
                        label: item.title,
                        content: `${option.content}（${
                          item.answer.split('#')[1]
                        }）`,
                      });
                    } else if (
                      item.answer.indexOf('#') < 0
                      && item.answer == option.id
                    ) {
                      self.displayList.push({
                        label: item.title,
                        content: option.content,
                      });
                    }
                  }
                } else {
                  self.displayList.push({
                    label: item.title,
                    content: '',
                  });
                }
                break;
              case '多选题':
                if (item.answer) {
                  // answer示例：'1,2,3'
                  const answers = item.answer.split(',');
                  let content = '';
                  for (const eachAnswer of answers) {
                    for (const option of item.approveSelectList) {
                      if (eachAnswer == option.id) {
                        content += `${option.content}，`;
                      }
                    }
                  }
                  self.displayList.push({
                    label: item.title,
                    content: content.slice(0, -1),
                  });
                } else {
                  self.displayList.push({
                    label: item.title,
                    content: '',
                  });
                }
                break;
              case '混答+多选':
                if (item.answer) {
                  // answer示例：'1,2#选项2的说明,3,4,5#选项5的说明'
                  const answers = item.answer.split(',');
                  let content = '';
                  for (const eachAnswer of answers) {
                    for (const option of item.approveSelectList) {
                      if (
                        eachAnswer.indexOf('#') >= 0
                        && eachAnswer.split('#')[0] == option.id
                      ) {
                        content += `${option.content}（${
                          eachAnswer.split('#')[1]
                        }），`;
                      } else if (
                        eachAnswer.indexOf('#') < 0
                        && eachAnswer == option.id
                      ) {
                        content += `${option.content}，`;
                      }
                    }
                  }
                  self.displayList.push({
                    label: item.title,
                    content: content.slice(0, -1),
                  });
                } else {
                  self.displayList.push({
                    label: item.title,
                    content: '',
                  });
                }
                break;
              case '简答-输入':
                self.displayList.push({
                  label: item.title,
                  content: item.answer,
                });
                break;
              case '简答-文本':
                self.displayList.push({
                  label: item.title,
                  content: item.answer,
                });
                break;
              case '图片':
                if (item.answer) {
                  const imgObj = JSON.parse(item.answer);
                  // console.log("图片imaobj", imgObj);
                  imgObj.forEach((element) => {
                    self.displayList.push({
                      label: item.title,
                      url: element.oldPath,
                      alt: element.name,
                    });
                    // console.log(self.displayList);
                  });
                } else {
                  self.displayList.push({
                    label: item.title,
                    content: '',
                  });
                }
                break;
              default:
                console.log('数据类型异常：【\n', item.topicName, '\n】');
            }
          }
        });
    },

    /**
     * @method
     * @desc 根据id获取人详情
     * @param {string} id 人的id
     */
    getManDetail(id) {
      const self = this;
      const url = `${window.SITE_CONFIG.baseUrl}/approve/approveMemberAccount/info/${id}`;
      self.$http.get(url).then((res) => {
        // console.log('getManDetail()获取到id =', id, '的详情：【\n', res.data, '\n】')
        self.manDetailData = res.data.data;
      });
    },

    /**
     * @method
     * @desc 点击按钮显示详情
     */
    showMore(id) {
      const self = this;
      this.getManDetail(id);
      this.$nextTick((_) => {
        self.$refs.manDetail.dialogVisible = true;
      });
    },

    /**
     * @method
     * @desc 点击显示放大图片弹窗
     * @param {string} url 图片的地址
     */
    displayPicture(url) {
      this.$refs.pictureEnlarge.init(url);
    },
    // 判断是图片还是文档
    isImg(url) {
      const res = url.slice(-4);
      if (
        res == '.png'
        || res == '.jpg'
        || res == 'jpeg'
        || res == '.gif'
        || res == '.bmp'
      ) {
        return true;
      }
      return false;
    },
  },
};
</script>

<style lang="less" scoped>
