  position: relative;
  border-bottom: 1px solid #f2f2f2;
  width: 529px;
  padding: 30px;
  /deep/.el-form-item__label {
    color: #999999;
    padding-right: 33px;
  }
  .status-img {
    position: absolute;
    right: 30px;
    top: 57px;
    height: 76px;
  }
}
</style>
